import './App.css';
import Header from './components/Header';
import About from './components/About';
import Footer from './components/Footer';
import Experience from './components/Experience';

function App() {

  return (
    <div className='App'>
      < Header id='header' />
      < About id='abt'/>   
      < Experience id='exp' />
      < Footer id='footer'/>
    </div>
  );
}

export default App;
